import React from 'react';
import Card from './Card.js';

const CardList = ({ robots }) => {
  const cardLoop = robots.map((user,i) => {
    return
      <div>
        <Card id={robots[i].id} name={robots[i].name} email={robots[i].email} />
      </div>
  })
  return (
    <div>
      { cardLoop }
    </div>
  )
};

export default CardList;
